script: |
  super -f text -I q10098.spq | sort > q10098.out

inputs:
  - name: q10098.spq
    data: |
      SELECT + - 22 + - + col1 + - col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col2 NOT BETWEEN + + 5 AND - ( + col1 ) * col0;
  - name: tab1

outputs:
  - name: q10098.out
    data: |
      -112
      -160
      -87
